import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import { useState } from "react";
import SlideTwo from "./SlideTwo";
import FinalSlide from "./FinalSlide";

function SlideShow() {
  return (
    <div className="Container">
      <div className="Header">
        <h1 className="text-center mt-4">Image Annotation</h1>
        <p className="text-center mt-4">Please check the right one</p>
      </div>
      <div className="img-container d-flex justify-content-center mt-6">
        <div style={{width:"45%"}}>
          <img src="/Testing/Test1_No_Tumor.jpg" style={{width:"90%"}}></img> 
          <div className="row justify-content-center mt-5">
            <input type="radio"></input>
          </div>        
        </div>
        <div style={{width:"40%"}}>
          <img src="/Testing/Test1_Tumor.jpg" style={{width:"90%"}}></img> 
          <div className="row justify-content-center mt-5">
          <input type="radio"></input>
          </div>        
        </div>
       

      </div>
     
    </div>
  );
}

export default SlideShow;
